            altitude
        }
    }

 componentDidMount() {
  window.navigator.geolocation.getCurrentPosition(
    position => this.setState({
      long: position.coords.longitude, 
      lat: position.coords.latitude})  
  );
}
    render() {
        return(
            <div>
                <h1>Main</h1>
